import { ADVANCE_PHASE, START_OVER } from '../types/index';

export const advancePhase = (phaseNumber) => {
  dispatchEvent({
    type: ADVANCE_PHASE,
    payload: phaseNumber
  });
}
export const startOver = () => {
  dispatchEvent({
    type: START_OVER
  });
}
